.signup-container {
  max-width: 400px;
  margin: 50px auto;
  padding: 20px;
  background-color: #ffffff;
  border-radius: 10px;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);

  h1 {
    text-align: center;
    font-size: 24px;
    margin-bottom: 20px;
  }

  .form-field {
    width: 100%;
    margin-bottom: 20px;
  }

  .sms-note {
    font-size: 12px;
    color: #666;
    margin-bottom: 20px;
    display: block;
  }

  button {
    width: 100%;
    padding: 10px;
    font-size: 16px;
  }
}
